import React from 'react';
import './App.css';
import Calendar from "react-material-ui-calendar";


function App() {
  return (
    <div className="App">
      <header className="App-header">
      <Calendar/>
        <p>
          TKC Class Schedule: First Class Scheduler
        </p>
      </header>
    </div>
  );
}

export default App;
